import React from 'react'

export default function GameOver(props) {
  if (props.show) {
    if (props.winner === 0) {
      <h1>"O Jogador 1 ganhou!"</h1>
    } else if (props.winner == 1) {
      <h1>"O Jogador 2 ganhou!"</h1>
    } else {
      <h1>"Deu velha!"</h1>
    }
  }
}
